query:
/*+ NoHashJoin(mc t ci) */ select count(*)
from movie_companies AS mc
inner join title AS t
on t.id = mc.movie_id AND mc.company_id = 2182 AND mc.company_type_id < 2 AND t.kind_id < 7 AND t.production_year < 1985
inner join cast_info AS ci
on t.id = ci.movie_id AND ci.person_id < 2027944 AND ci.role_id < 2;
